import React, { useEffect, useState } from "react";
import Ranking from "../../../components/Ranking";
import Heading from "../../../components/Heading";

function DashboardPage() {
  const [data, setData] = useState({});
  useEffect(() => {
    fetch("admin/dashboard")
      .then((res) => res.json())
      .then((d) => setData(d.users));
  }, []);
  console.log(data);
  return (
    <div className="ranking">
      <Heading
        img={{ path: "images/leagues/fifa/fifa.png", alt: "FIFA" }}
        title="National Team Ranking"
      />
      <Ranking
        head={{
          0: { name: "Id", atribute: "id", sortable: true },
          1: {
            name: "Username",
            atribute: "username",
            sortable: true,
          },
          2: { name: "Email", atribute: "email", sortable: true },
          3: {
            name: "Followed Leagues",
            atribute: "followed_leagues",
            sortable: false,
          },
          4: {
            name: "Followed Matches",
            atribute: "",
            sortable: true,
            coloredNumber: true,
          },
          5: {
            name: "Admin",
            atribute: "admin",
            sortable: true,
            coloredNumber: true,
          },
        }}
        sorting={{ by: "id", order: "asc" }}
        tbody={data}
      />
    </div>
  );
}

export default DashboardPage;
